descriptions:
{'es-ES': 'Edificio de cinco alturas, planta de calle destinada a locales comerciales, y esto de alturas a viviendas situado en el municipio de Soria, capital de provincia. 
La vivienda se distribuye en dos dormitorios, salón, cocina, un baño y una terraza cubierta. 

La vivienda se ubica en pleno centro histórico, por lo que disfruta de todos los servicios propios de una pequeña capital; comercios, ocio, centros educativos y médicos.'}

{'es-ES': 'Se Vende casa Rústica en Almenar de Soria, a 20 minutos de Soria capital, la casa dispone de 2 plantas más 1 bajo cubierta, diversos almacenes que bien se podrían derruir o rehabilitar según necesisades, 1 baño y cocina montada.
La casa está para entrar a vivir, o también se le podría aplicar una pequeña reforma para actualizarla, pero no es estrictamente necesario ya que el tejado esta hecho hace poco tiempo.

Para ver la casa o hacer cualquier consulta, contactar por telefono y whatsapp.'}

{'es-ES': 'VENTA URGENTE. PRECIO FINAL REBAJADO


El edificio de encuentra situado en la localidad de Ventosa de San Pedro Manrique, a 4 kilómetros de San Pedro Manrique. Está construido siguiendo las características y elementos arquitectónicos del lugar, combinando la piedra, madera, etc… 

Cuenta en su interior con dos plantas   sotano. La planta baja consta de un amplio salón con hogar chimenea de leña, televisión,  El comedor es igualmente muy amplio con una mesa para 8 comensales. La cocina está completamente equipada con frigorífico, horno, microondas, vitrocerámica, lavavajillas, etc… También cuenta con un almacén trastero con leña. En la primera planta dispone de 3 habitaciones, dos de matrimonio y otra doble, se completa con un baño completo y un amplio balcon exterior. Toda la casa cuenta con calefacción, la zona de ducha es termostática, cobertura Wifi y teléfono, así como el acceso con vehículo hasta la puerta.'}

{'es-ES': 'Se vende chalet adosado en Camaretas. Cuenta con unos 148 metros cuadrados de vivienda y 81 metros de accesos al garaje (parte delantera y trasera) más buhardilla.

Tiene 3 habitaciones, buhardilla, garaje, un baño, 1 aseo.

Para más información, contactar.'}
